import React from 'react'

export default function contact() {
  return (
    <div className='max-w-[1100px] mx-auto justify-center items-center flex flex-col h-[80vh]'>
        <h1 className=' text-[50px] text-[silver]'><span id='span'>04.</span> What's Next?</h1>
        <div>
            <h1 className=' m-5 text-[25px] text-[silver]'>Get In Touch</h1>

                <a href='https://mail.google.com/mail/u/1/#inbox?compose=CllgCJvlqLrGsZZjQLTlRwbWrwtGBtJDFnNCjbmtnFDLftXznDRRbBSgQwtBVPBggvGwBpPVcBB'>            <button className=' p-4 rounded-xl  border-2 hover:scale-105 ease-in-out duration-200 border-[#61dafb] text-[white] hover:bg-[#61dafb7c]'>Say Hello</button></a>

        </div>
    </div>
  )
}
